export const newGame = () => {
  return {
    type: 'NEW_GAME'
  };
};

export const playerMove = (history, squares) => {
  return {
    type: 'PLAYER_MOVE',
    history,
    squares
  };
};

export const sortHistory = isDecending => {
  return {
    type: 'SORT_HISTORY',
    isDecending
  };
};
